import React from "react";
import "./PopUp.css"; // Import CSS cho Popup

const PopUp = ({ data, onClose }) => {
  // Logic vẽ biểu đồ sử dụng dữ liệu từ props data

  return (
    <div className="popup">
      <div className="popupInner">
        {/* Nút đóng popup */}
        <button className="closeButton" onClick={onClose}>Close</button>
        {/* Thêm logic vẽ biểu đồ vào đây */}
      </div>
    </div>
  );
};

export default PopUp;
